import React from 'react';
import BudgetItem from '../components/BudgetItem';

class Home extends React.Component {
    render() {
        return (
            <div>
                <h1>Next Budget</h1>
                <BudgetItem item="test"/>
            </div>
        )
    }
}

export default Home;
